// Import the required modules into your "server.js" file
const express = require('express');
const bodyParser = require('body-parser');
const multer = require('multer');
const sharp = require('sharp');

// Create an Express application
const app = express();

// Use the "body-parser" middleware to parse the request body
app.use(bodyParser.urlencoded({ extended: true }));
app.use(bodyParser.json());

// Define the storage for the uploaded files
const storage = multer.diskStorage({
  // Specify the destination folder for the uploaded files
  destination: './uploads',
  // Specify a function to generate the filename for the uploaded file
  filename: (req, file, cb) => {
    // Use the original filename of the uploaded file
    cb(null, file.originalname);
  }
});

// Create a Multer instance with the defined storage
const upload = multer({ storage });

// Define the "GET" route for serving the "index.html" file
app.get('/', (req, res) => {
  // Send the "index.html" file as the response
  res.sendFile(__dirname + '/index.html');
});

// Define the "POST" route for handling the image upload
app.post('/upload', upload.single('file'), (req, res) => {
  // Get the uploaded file from the request object
  const { file } = req;
  // Get the original name and buffer of the uploaded file
  const { originalname, buffer } = file;

  // Use Sharp to resize the uploaded image
  sharp(buffer)
    .resize({ width: 500, height: 500 }) // Resize the image to 500x500 pixels
    .toFormat('jpeg') // Convert the image to JPEG format
    .toFile(`./uploads/${originalname}`); // Save the resized image to the uploads folder

  // Send a response to indicate that the image has been resized and saved
  res.send(`The image ${originalname} has been resized and saved to ./uploads/`);
});

// Start the server and listen on a port
const PORT = process.env.PORT || 3000;
app.listen(PORT, () => {
  // Log a message to indicate that the server is running
  console.log(`Server running on port ${PORT}`);
});
